function Li_fournisseurs(props) {
    return (
                <li className="list-group-item" key={props.fournisseurs.identreprise}> {props.fournisseurs.matricule} : {props.fournisseurs.nom}<input name="fournisseur_demande" 
                ref={(element) => {
                  props.fournisseur_demande.current[props.index] = element;
                }} 
                type="hidden" value={props.fournisseurs .identreprise} />  </li>
    );
}

export default Li_fournisseurs;
